import {
  Routes,
  Route
} from "react-router-dom";

const App = () => (
  <>
    <Routes>
      <Route path="/" element={<h1>Home</h1>} />
      <Route path="bang" element={<h1>Bang!</h1>} />
      <Route path="dart" element={<h1>Dart</h1>} />
    </Routes>
  </>
)

export default App;
